import { Link, NavLink } from "react-router-dom";
// import class_navbar from "./Navbar.module.css";
import class_navbar from "./Navbar1.module.css";
// import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className={class_navbar.nav}>
      <div className={class_navbar.item}>
        <NavLink to="/dialogs" active={class_navbar.active23}>
          Messages
        </NavLink>
      </div>
      <div className={class_navbar.item}>
        <NavLink to="/profile" activeClassName={class_navbar.active23}>
          Profile
        </NavLink>
      </div>
      <div className={class_navbar.item}>
        <NavLink to="/news" activeClassName={class_navbar.active23}>
          News
        </NavLink>
      </div>
      <div className={class_navbar.item}>
        <NavLink to="/music" activeClassName={class_navbar.active23}>
          <Link activeClassName="active"></Link>
          Music
        </NavLink>
      </div>
      <div className={class_navbar.item}>
        <NavLink to="/settings" activeClassName={class_navbar.active23}>
          Settings
        </NavLink>
      </div>
    </nav>
  );
};

export default Navbar;
